window.bookSummaryJSON = "<p>The eighth realm, the unpassable realm.</p> <p>The eighth realm doesn’t stand as a realm onto itself, but as a question.</p> <p><b><i>Why do you fight?</i></b></p> <p>Merely gaining levels and having a higher cultivation isn’t enough to pass the eighth realm’s test into the ninth realm. Find your truth, understand your reason; only then can you pass the eighth realm.</p> <p>It might be Erik and Rugrat’s hardest challenge yet.</p>"; 
